import React, { useState } from 'react';
import axios from 'axios';
import { useNavigate } from 'react-router-dom';
import './Register.css';

const Register = () => {
  const [email, setEmail] = useState('');
  const [status, setStatus] = useState('');
  const [emailValid, setEmailValid] = useState(false);
  const [verificationCode, setVerificationCode] = useState('');
  const [enteredCode, setEnteredCode] = useState('');
  const [userEmail, setUserEmail] = useState('');
  const navigate = useNavigate();

  const handleEmailChange = (e) => {
    setEmail(e.target.value);
  };

  const handleEmailSubmit = async () => {
  const domain = email.split('@')[1];  // –ü–æ–ª—É—á–∞–µ–º –¥–æ–º–µ–Ω –∏–∑ email

  try {
    // –û—Ç–ø—Ä–∞–≤–ª—è–µ–º –∑–∞–ø—Ä–æ—Å –Ω–∞ —Å–µ—Ä–≤–µ—Ä –¥–ª—è –ø—Ä–æ–≤–µ—Ä–∫–∏ –¥–æ–º–µ–Ω–∞
    console.log("–û—Ç–ø—Ä–∞–≤–ª—è–µ–º email –Ω–∞ —Å–µ—Ä–≤–µ—Ä:", email);
    const response = await axios.post('http://127.0.0.1:5000/check_email', { email });
    console.log("–û—Ç–≤–µ—Ç —Å–µ—Ä–≤–µ—Ä–∞:", response.data);  // –õ–æ–≥–∏—Ä—É–µ–º –æ—Ç–≤–µ—Ç –æ—Ç —Å–µ—Ä–≤–µ—Ä–∞

    // –ï—Å–ª–∏ –¥–æ–º–µ–Ω –Ω–∞–π–¥–µ–Ω –≤ –æ–¥–Ω–æ–π –∏–∑ –∫–∞—Ç–µ–≥–æ—Ä–∏–π
    if (response.data.isValid) {
      setEmailValid(true);
      setLevel(response.data.level);  // –°–æ—Ö—Ä–∞–Ω—è–µ–º —É—Ä–æ–≤–µ–Ω—å –¥–æ—Å—Ç—É–ø–∞
      const code = Math.random().toString(36).slice(-12); // –ì–µ–Ω–µ—Ä–∞—Ü–∏—è 12-–∑–Ω–∞—á–Ω–æ–≥–æ –∫–æ–¥–∞
      setGeneratedCode(code);

      // –û—Ç–ø—Ä–∞–≤–∫–∞ –∫–æ–¥–∞ –Ω–∞ –ø–æ—á—Ç—É
      sendEmail(email, code);

      setStatus('–ù–∞ –≤–∞—à email –æ—Ç–ø—Ä–∞–≤–ª–µ–Ω –∫–æ–¥ —Ä–µ–≥–∏—Å—Ç—Ä–∞—Ü–∏–∏.');
    } else {
      setStatus('–£–≤—ã, –≤–∞—à –¥–æ–º–µ–Ω –Ω–µ –∑–∞—Ä–µ–≥–∏—Å—Ç—Ä–∏—Ä–æ–≤–∞–Ω –≤ –Ω–∞—à–µ–π —Å–∏—Å—Ç–µ–º–µ.');
    }
  } catch (error) {
    console.error('–û—à–∏–±–∫–∞ –ø—Ä–∏ –ø—Ä–æ–≤–µ—Ä–∫–µ email', error);
    setStatus('–ü—Ä–æ–∏–∑–æ—à–ª–∞ –æ—à–∏–±–∫–∞ –ø—Ä–∏ –ø—Ä–æ–≤–µ—Ä–∫–µ email. –ü–æ–ø—Ä–æ–±—É–π—Ç–µ —Å–Ω–æ–≤–∞.');
  }
};


  const handleCodeSubmit = async () => {
    if (!email || !verificationCode) {
        setStatus("–í–≤–µ–¥–∏—Ç–µ –∫–æ–¥!");
        return;
    }

    try {
        const response = await axios.post("http://127.0.0.1:5000/verify_code", {
            email: email,
            code: verificationCode
        });

        if (response.data.success) {
            setStatus("‚úÖ –†–µ–≥–∏—Å—Ç—Ä–∞—Ü–∏—è —É—Å–ø–µ—à–Ω–∞!");
            console.log("üéâ –î–æ—Å—Ç—É–ø –ø—Ä–µ–¥–æ—Å—Ç–∞–≤–ª–µ–Ω:", level);
        } else {
            setStatus("‚ùå –ù–µ–≤–µ—Ä–Ω—ã–π –∫–æ–¥, –ø–æ–ø—Ä–æ–±—É–π—Ç–µ —Å–Ω–æ–≤–∞.");
        }
    } catch (error) {
        console.error("–û—à–∏–±–∫–∞ –ø—Ä–∏ –ø—Ä–æ–≤–µ—Ä–∫–µ –∫–æ–¥–∞", error);
        setStatus("‚ùå –û—à–∏–±–∫–∞ –ø—Ä–æ–≤–µ—Ä–∫–∏. –ü–æ–ø—Ä–æ–±—É–π—Ç–µ —Å–Ω–æ–≤–∞.");
    }
};

  return (
    <div className="register-container">
      <h2>–í–≤–µ–¥–∏—Ç–µ –≤–∞—à—É –∫–æ—Ä–ø–æ—Ä–∞—Ç–∏–≤–Ω—É—é –ø–æ—á—Ç—É</h2>
      <input type="email" value={email} onChange={handleEmailChange} className="register-input" placeholder="–í–≤–µ–¥–∏—Ç–µ email" />
      <button onClick={handleEmailSubmit} className="register-btn">–ó–∞—Ä–µ–≥–∏—Å—Ç—Ä–∏—Ä–æ–≤–∞—Ç—å—Å—è</button>
      <button onClick={() => navigate('/')} className="guest-btn">–í–æ–π—Ç–∏ –∫–∞–∫ –≥–æ—Å—Ç—å</button>

      {emailValid && (
        <>
          <h3>{status}</h3>
          <input type="text" value={enteredCode} onChange={(e) => setEnteredCode(e.target.value)} className="register-input" placeholder="–í–≤–µ–¥–∏—Ç–µ –∫–æ–¥" />
          <button onClick={handleCodeSubmit} className="register-btn">–ü—Ä–æ–≤–µ—Ä–∏—Ç—å –∫–æ–¥</button>
        </>
      )}

      {!emailValid && <h3>{status}</h3>}
    </div>
  );
};

export default Register;
